import "./ChatBotContainer.scss";
import ChatBot from "react-simple-chatbot";

function ChatBotContainer() {
  return (
    <ChatBot
      steps={[
        {
          id: "hello-world",
          message: "Hello World!",
          end: true,
        },
      ]}
    />
  );
}

export default ChatBotContainer;
